import React from "react";

function Header(){
 
    const client = 'Design'
    const title = {
        designer : 'Design',
        programmer : 'Programming'
    }
    const client_info = {
        Name : 'Houssam',
        Last_Name : 'Dahbi'
    }




    return(
        <div className="navbar bg-dark rounded">
            <h2 className="text-secondary">
            Hello {` +" "+ client_info.Last_Name`}
            </h2>
        <h1 className="text-white">
            {client == client ? title.designer : title.programmer}
            is my life</h1>
        </div>
    );
}
export default Header
